import React from "react";

export const AddAttribute = () => {
  return (
    <div className="bg-danger container p-4">
      <div className="row">
        <input
          type="text"
          className="rounded p-1  col-sm-12 col-md-3"
          placeholder="عنوان ویژگی جدید"
        />
        <input type="text" className="rounded p-1  col-sm-12 col-md-3" placeholder="واحد ویژگی جدید" />
        <div className="form-check form-switch col-sm-12 col-md-2">
          <input type="checkbox" className="form-check-input" />
          <label htmlFor="" className="form-check-label">
            نمایش در فیلتر
          </label>
        </div>
        <i class="fa-solid fa-clipboard-check  col-sm-12 col-md-2 "></i>
      </div>
    </div>
  );
};
